import React, {useState} from "react";
import { useNavigate } from 'react-router-dom';
import { Input , Form} from "reactstrap";
import * as Yup from "yup";

const Register = () =>{
    let navigate = useNavigate();
    const [message, setMessage] = useState(" ");
    const [successful, setsuccessful] = useState(false);
    const [user,setUser] = useState({
        username:"",
        email:"",
        password:""
    });
    const formik = useFormik({
        initialValues: Yup.object({
            username: Yup.string()
            .max(15,"Must be 15 caracters or less")
            .min(3,"Must be 3 caracters")
        })
    })
    return(
        <div className="col-md-12">
            <h1>Registration</h1>
            <div className = "card card-container">
            <img src="//ssl.gstatic.com/accounts/ui/avatar_2x.png"
            alt="profile"
            className="profile-img-card"
            />

            <Form>
                <div className="form-group">
                    <label>Username</label>
                    <Input type="text" className="form-group" name="username"></Input>
                </div>

                <div className="form-group">
                    <label>Email</label>
                    <Input type="text" className="form-group" name="email"></Input>
                </div>

                <div className="form-group">
                    <label>Password</label>
                    <Input type="text" className="form-group" name="password"></Input>
                </div>
                <div className="btn btn-primary btn-block" type="submit">
                    Sign Up
                </div>

            </Form>
             </div>

        </div>
    );
};

export default Register;
